INSERT INTO `v1_bf78211233320892ce512587b460cb704eba44b8bc31621b912e06ada3c9bf21` VALUES (10, 102711, 0, 0, 1, 16612, 1, "ちょ、ちょっとアンナさん……\nあなた全身、絵の具だらけで\n動くたびに飛び散ってますわ。\n少し大人しくしてもらえますか？", 16612031, 0.5, 11);
